import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = (props) => {
  // Ensure props.object is defined and is an array
  if (!props.object || !Array.isArray(props.object)) {
    return <div>No data available</div>;
  }

  // Map over props.object and render Tile components
  const tiles = props.object.map((info, index) => (
    <Tile key={index} info={info} />
  ));

  return <div>{tiles}</div>;
};
